import Axios from "@/utils/request";
import Error from "./http/TimeError";
import qs from "qs"

/*APi  接口函数区 */
export function getyzm(data) {
    console.log(data);
    return Axios({
        url: "/user/login", // 这个地址是去掉公共地址剩下的地址
        method: "POST", // 请求方式 支持多种方式  get post put delete 等等
        data:qs.stringify(data) //发送请求要配置的参数 无参数的情况下也可以不写
    }).catch((err)=>{
        Error(err)
    });
    
}
